import React, { useState } from "react";
import { StyleSheet, View, SafeAreaView, Text, Picker } from "react-native";
import { TextInput } from "react-native-paper";

import Button from "../components/Button";
import styles from "../styles/Styles";

export default function Banco({ navigation }) {
  const [selectedValue, setSelectedValue] = useState("masculino", "feminino");
  return (
    <SafeAreaView style={styles.safeView}>
      <Text style={styles.title}>Cadastro</Text>

      <div>
        <Text style={styles.label}>Nome:</Text>
        <TextInput
          mode="outlined"
          style={styles.input}
          placeholder="Digite Seu Nome"
        ></TextInput>
      </div>
      <div>
        <Text style={styles.label}>Idade:</Text>
        <TextInput
          id="name"
          mode="outlined"
          style={styles.input}
          placeholder="Digite Sua Idade"
          keyboardType="numeric"
        ></TextInput>
      </div>
      <div>
        <Text style={styles.label}>GÃªnero:</Text>
        <Picker
          selectedValue={selectedValue}
          style={{
            height: 30,
            width: 238,
            marginTop: 10,
            backgroundColor: "#343732",
            color: "white",
          }}
          onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}
        >
          <Picker.Item label="Masculino" value="masculino" />
          <Picker.Item label="Feminino" value="feminino" />
        </Picker>
      </div>
    </SafeAreaView>
  );
}
